import React, { useState, useEffect } from 'react';
import './TopNav.css';

const TopNav = ({ onOpenMenu }) => {
  const [scrolled, setScrolled] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      if (window.scrollY > 50) {
        setScrolled(true);
      } else {
        setScrolled(false);
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  return (
    <header className="site-header">
      {/* Primary Top Navigation - Dark Bar */}
      <div className={`primary-nav ${scrolled ? 'scrolled' : ''}`}>
        <div className="nav-container">
          <div className="nav-left">
            <button className="locations-btn" onClick={onOpenMenu}>
              <span className="hamburger-icon">
                <span className="line"></span>
                <span className="line"></span>
                <span className="line"></span>
              </span>
              <span className="locations-text">LOCATIONS</span>
            </button>
          </div>
          
          <div className="nav-center">
            <a href="/" className="main-logo">KABOUL</a>
          </div>
          
          <div className="nav-right">
            <a href="tel:020-7123-4567" className="phone-number">020 7123 4567</a>
            <a href="#gifts" className="nav-link">GIFTS</a>
            <a href="#book" className="book-now-btn">
              <span className="calendar-icon">
                <svg width="16" height="16" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                  <rect x="3" y="4" width="18" height="18" rx="2" stroke="currentColor" strokeWidth="2"/>
                  <path d="M3 10H21" stroke="currentColor" strokeWidth="2"/>
                  <path d="M8 2L8 6" stroke="currentColor" strokeWidth="2" strokeLinecap="round"/>
                  <path d="M16 2L16 6" stroke="currentColor" strokeWidth="2" strokeLinecap="round"/>
                </svg>
              </span>
              BOOK NOW
            </a>
          </div>
        </div>
      </div>

      {/* Secondary Navigation - White Bar with Restaurant Name */}
      <div className={`secondary-nav ${scrolled ? 'scrolled' : ''}`}>
        <div className="nav-container">
          <div className="restaurant-name">
            <a href="/">Kaboul Gourmet</a>
          </div>
          
          <nav className="menu-nav">
            <ul>
              <li><a href="#menus">MENUS</a></li>
              <li><a href="#whats-on">WHAT'S ON</a></li>
              <li><a href="#private-dining">PRIVATE DINING</a></li>
              <li><a href="#about">ABOUT</a></li>
              <li><a href="#reviews">REVIEWS</a></li>
              <li><a href="#contact">CONTACT</a></li>
              <li><a href="#newsletter">NEWSLETTER SIGNUP</a></li>
            </ul>
          </nav>
        </div>
      </div>
    </header>
  );
};

export default TopNav;
